script: |
  super -f text -I q8496.spq | sort > q8496.out

inputs:
  - name: q8496.spq
    data: |
      SELECT - - col2 * col0 - + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 81 NOT BETWEEN - col2 * + col1 + + 37 AND + 43;
  - name: tab2

outputs:
  - name: q8496.out
    data: |
      1012
      2496
      4275
